import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import Item from './Item.js';


class List extends Component {

    static defaultProps = {
        content: "",
        itemArr: []
    }

    render() {
        var listEntries = this.props.entries;

        function generateLine(item) {
            return
            <div id="DV_Thing">
                <button key={item.key}>{item.text}</button>
                {/* <button id="BT_Thing" data-idx="${idx}" class="textField" onclick="Edit(${idx})">${param}</button> */}
            </div >
        }

        var listItems = listEntries.map(generateLine);

        return (
            <div id="DV_Thing">
                {listItems}
            </div>
        )
    }
}

export default List;
